    padding-left: 24px;
}

.wiki_form-button {
    margin-left: 0%;
}

.wiki-upload-table {
    margin: 8px auto;
    clear: both;
}

.wiki-upload-table table {
    margin: auto;
}

.wiki-upload-table h3 {
    margin: 4px 0;
    text-align: center;
}

.wiki-upload-section {
    border: 1px solid #eee;
    width: 400px;
    margin: 8px auto;
}

.wiki-upload-section legend {
    font-weight: bold;
    font-size: 0.9em;
    margin-left: 16px;
}

