    position: absolute;
    bottom: 0;
    right: 0;
    font-size: 11px;
    text-align: right;
    color: #fff;
    background-color: rgba(0, 0, 0, 0.6);
    padding: 0 3px;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    max-width: 100%;
    box-sizing: border-box;
}

