.block-stash-item.item-xsmall .item-image .item-label {
    display: none;
}

.block-stash-item.item-small:hover .item-label,
.block-stash-item.item-xsmall:hover .item-label {
    display: block;
    bottom: -22px;
    background-color: black;
    width: 90px;
    max-width: none;
    text-align: center;
    border-radius: 5px;
    padding: 0 5px;
    right: auto;
    left: 0;
    left: -webkit-calc(50% - 90px / 2); /* stylelint-disable-line */
