  }
  35% {
    top: -23.45%;
  }
  40% {
    top: -26.8%;
  }
  45% {
    top: -30.15%;
  }
  50% {
    top: -33.5%;
  }
  55% {
    top: -36.85%;
  }
  60% {
    top: -40.2%;
  }
  65% {
    top: -43.55%;
  }
  70% {
    top: -46.9%;
  }
  75% {
    top: -50.25%;
  }
  80% {
    top: -53.6%;
  }
  85% {
